// src/componentes/TarjetaFuente.js
import React from 'react';

const TarjetaFuente = () => {
  return (
    <div className="tarjeta">
      <h2>Fuente de datos</h2>
      <div className="info">
        <p><strong>Fuente:</strong> MINVIVIENDA_AGUA_SANEAMIENTO</p>
        <p><strong>Total:</strong> 1</p>
      </div>
    </div>
  );
};

export default TarjetaFuente;
